import React from 'react';
import { MDBTypography, MDBContainer, MDBNavbar,  } from 'mdb-react-ui-kit'
import memories from './images/memories.png';


const App = () => {
    return (
        <MDBContainer maxidth = 'lg'>
            <MDBNavbar position='static' color='inherit'>
            <MDBTypography variant='h2' align='center'>Memories</MDBTypography>
            <img src = {memories} alt='memories' height='60'/>
            </MDBNavbar>
        </MDBContainer>
    );
}


export default App;
